//		HAL_Delay(10);
//	
//	}
	// ÏÔÊ¾¿ª»ú»­Ãæ3s
	display_Boot_Animation();
	//SET_BGLight(flir_conf.flir_sys_Bright); 
	Save_Parameter();                            // ±£´æ9¸öÏµÍ³²ÎÊýµ½FLASH	
	HAL_Delay(1000);
	HAL_Delay(1000);
